import React from "react";
import { Tile } from "../tile/Tile";


// 
export const TileList = ({contacts}) => {
  return (
    <div>
      {contacts.map((contact)=>{
        <Tile name={contact.name} phone={contact.phone} email={contact.email} key={contacts.indexOf(contact)} />
      })
      } 
    </div>
  );
};
